import {backendLookup} from '../lookup'

export function PostCreate(newPost, callback) {
    backendLookup("POST", "/posts/create/", callback, {tweet: newPost})
  }

  export function PostList(callback) {
    backendLookup("GET", "/posts/", callback)
  }
